member.example:
The following C# example illustrates how to draw custom graphics in the display by sinking
the PaintGraphics event. It requires an In-Sight SDK license because it uses the
 property in order to obtain the dimensions of the
acquired image.

// This method handles the PaintGraphics event of the display in order
// to draw custom graphics in front of the image and behind the grid.
private void cvsInSightDisplay1_PaintGraphics(object sender, System.Windows.Forms.PaintEventArgs e)
{
  if (cvsInSightDisplay1.Results != null)
  {
    CvsImage img = cvsInSightDisplay1.Results.Image;
    if (img != null)
    {
      // Draw a blue box in the center of the image. This is drawn in image coordinates
      // so the size and line width of this graphic will scale with the image, 
      // getting smaller as the image is zoomed out and getting larger as the image
      // is zoomed in.
      e.Graphics.DrawRectangle(Pens.Blue, img.Width/2-5, img.Height/2-5, 10, 10);

      // Compute the location of the center of the image in client coordinates
      // so we can draw a cross there after resetting the transform.
      Point[] pts = new Point[1] {new Point(img.Width/2, img.Height/2)};
      e.Graphics.Transform.TransformPoints(pts);
      Point cp = pts[0]; // just for readability

      // Reset the transform in order to draw in client coordinates.
      e.Graphics.ResetTransform();

      // Display the image size at a fixed location behind the grid
      e.Graphics.DrawString("Image size: " + img.Width.ToString() + " x " +
        img.Height.ToString(), this.Font, Brushes.Orange, 50, 50);

      // Draw a yellow cross in the center of the image. This is drawn in client coordinates
      // so the size and line width of this cross will NOT scale as the ImageScale changes.
      // We must use the image center point transformed into client coordinates (above)
      // in order to draw the cross in the proper location.
      e.Graphics.DrawLine(Pens.Yellow, cp.X, cp.Y-5, cp.X, cp.Y+5);
      e.Graphics.DrawLine(Pens.Yellow, cp.X-5, cp.Y, cp.X+5, cp.Y);
    }
  }
}

